INSERT INTO `Game` (`id`, `revision`, `version`, `backgroundImageLink`, `mapTitle`, `mapLatitude`, `mapLongitude`, `mapZoom`, `mapLayersCSV`, `cardsReadonly`, `clusterMaster`, `currentMove_id`, `lastMove_id`, `defaultActionPlanImagesText`, `defaultActionPlanMapText`, `defaultActionPlanTalkText`, `defaultActionPlanThePlanText`, `defaultActionPlanVideosText`, `defaultActionPlanMapLon`, `defaultActionPlanMapLat`, `description`, `displayedMoveNumberOverride`, `endDate`, `maxUsersOnline`, `maxUsersRegistered`, `preregistrationDate`, `question_id`, `readonly`, `startDate`, `title`, `acronym`, `reportIntervalMinutes`, `restrictByQueryListInterval`, `headerBranding_id`, `linkRegexs`, `topCardsReadonly`, `emailConfirmation`, `secondLoginPermissionPage`, `secondLoginPermissionPageTitle`, `secondLoginPermissionPageText`, `showFouo`, `fouoDescription`, `showPriorMovesCards`, `showPriorMovesActionPlans`, `playOnPriorMovesCards`, `editPriorMovesActionPlans`, `fouoButtonImage`, `pdfAvailable`, `inGameMailEnabled`, `userSignupAnswerPoints`, `userActionPlanCommentPoints`, `cardSuperInterestingPoints`, `actionPlanCommentPoints`, `actionPlanThumbFactor`, `actionPlanAuthorPoints`, `actionPlanSuperInterestingPoints`, `actionPlanRaterPoints`, `cardAncestorPoints`, `cardAuthorPoints`, `cardAncestorPointsGenerationFactors`, `externalMailEnabled`, `adminLoginMessage`, `bootStrapping`, `headerBannerImage`, `actionPlansEnabled`, `showHeaderBranding`, `playIdeaButtonImage`, `gameHandle`)
VALUES
	(1,1,20150403,'https://web.mmowgli.nps.edu/mmowMedia/images/nauticalBackground.jpg','NAVAIR Patuxent River Maryland',38.279646,-76.423816,12,'ESRI_WORLD_IMAGERY',00000000,'clustermaster',1,1,'Game.defaultActionPlanImagesText: Photographs, pictures, and charts bring your action plan to life and convey important details that might not fit easily into the text of your plan. \n<p>\nYou can search online for images, or upload images from your own desktop. Be sure to add a caption that explains the significance of each image.\n</p>\n<i>Hint: You may want to give one of your team members the responsibility for tracking down the images that support your plan.</i>\n','You can annotate a map to show how your plan would work. Here are some ways to use the map:\n<ul>\n<li>Annotate it with numbered steps to show how your plan will unfold.</li>\n\n<li>Mark the locations of resources your plan will draw on--or put in place.</li>\n\n<li>Add data points that explain the what\'s happening on the ground.</li>\n</ul>\nMaps are powerful tools for planning. Use yours in the way that best supports your plan!\n</p>\n<p>\nAs an author, you may make changes to this map by re-centering, zooming and adding markers.\nSave your changes using one or both of the save buttons above the map before leaving this page. (Non authors do not see the buttons.)\n</p>\n<b>New markers (authors only)</b>:  drag one of the following icons onto the map.  To delete a marker, click it on the map and follow directions in the popup window.\n</p>\n','Game.defaultActionPlanTalkText: Coming up with an action plan -- with people you may not know across multiple time zones -- can be a challenge. But you can use this private* chat room to trade ideas in real time or leave messages for your teammates.\n<p>\nYou might want to start by discussing the basic ideas in your card chain. How are you going to make those ideas work?  What\'s the core idea?  And what are the actions you need to take? \n</p><p>\nTalk it over here. But don\'t be shy about just starting to fill in the plan. Switch back and forth between The Plan and this team discussion space as you build your winning action plan.\n</p>\n*<i>Your chats cannot be seen by anyone else in the game other than gamemasters. However, they will be available to analysts for post-game analysis</i>.','Describe your action plan here. Talk it over with your fellow authors in real-time or asynchronous chat. Add images, videos, or map annotations. Remember this is a team effort! So work with your teammates to come up with the best possible plan.\n<p>\nNeed more information? Check our <a href=\"https://portal.mmowgli.nps.edu/instructions/-/asset_publisher/e02P/content/how-to-build-action-plans\" target=\"_portal\">help</a> page.\n</p>\n<p>\n<b>The 5 Basic Steps:</b>\n<ol>\n<li>Start by entering a headline that captures the big idea.</li>\n\n<li>Describe the basic plan in the What Is It? box.</li>\n\n<li>Make a list of the resources you need in the What Will It Take? box.</li>\n\n<li>Outline the steps to succeed in the How Will It Work box. <i>Hint: Use your card chain as a starting place</i>.</li>\n\n<li>Sum up the impact in the last box, How Will Change the Situation?</li>\n</ol>\nClick Save Changes often to make sure your text is saved. Click History to review previous versions.\n</p><p>\nWork fast. Work smart. Work together.\n<b><i>Good luck!</i></b></p>\n','A video is worth a thousand words.  Consider:<OL><LI> Making a 1-2 minute video to tell us about your action plan.</LI><LI>Share a video you\'ve found that helps support your action plan.</LI></OL>Add a caption to highlight the point you\'re making.',-99.4759979248047,38.5970001220703,NULL,NULL,NULL,250,10000,NULL,1,00000000,NULL,'localhost MmowgliGame','localhost',60,00000001,NULL,NULL,00000000,00000000,00000001,'Important!','Please do not contribute any material specific to ongoing contracts or solicitations that are in any way competition sensitive.',00000000,'Unclassified -- For Official Use Only',00000000,00000001,00000000,00000000,'fouo250w36h.png',00000000,00000001,10,1,10,3,1,100,12,5,1,5,'5.0 4.0 3.0 2.0 1.0',00000001,NULL,00000001,'mmowgliBanner350w130h.png',00000001,00000001,'playIdeaButt124w18h.png','mmowgli');

