INSERT INTO `Pages` (`id`, `confirmationEmail`, `actionPlanInviteEmail`, `confirmedReminderEmail`, `welcomeEmail`, `confirmationEmailSubject`, `confirmedReminderEmailSubject`, `welcomeEmailSubject`, `actionPlanInviteEmailSubject`, `passwordResetEmail`, `passwordResetEmailSubject`, `gameMasterRegistrationEmail`, `gameMasterRegistrationEmailSubject`)
VALUES
	(1,'<p>Greetings, <b>[$UNAME$]</b>, from <i>[$GAMEACRONYM$] [$GAMEHANDLE$]</i>, the \"Massively Multiplayer Online War Game Leveraging the Internet\".</p><p>At [$DATETIME$], someone (presumably you) signed up to play <i>[$GAMEHANDLE$] / [$GAMENAME$]</i>.</p><p>Please follow <a href=\'[$CONFIRMLINK$]\'>this link to confirm your registration</a>.</p><p>Problems may always be reported on the <a href=\'[$TROUBLELINK$]\'>[$GAMEHANDLE$] trouble report</a> page at <a href=\'[$TROUBLELINK$]\'>[$TROUBLELINK$]</a>, or by email to <br /><a href=\'mailto:[$TROUBLEMAILTO$]\'>[$TROUBLEMAILTO$]</a>.</p><p>More information is also available on the <a href=\'[$PORTALLINK$]\'>[$GAMEHANDLE$] portal</a>.</p><p>Thanks for your interest in playing <i>[$GAMEACRONYM$] [$GAMEHANDLE$]</i>.  <b>Play the game, change the game!</b></p>','<p>Greetings, <b>[$UNAME$]</b>, from <i>[$GAMEACRONYM$] mmowgli</i>, the \"Massively Multiplayer Online War Game Leveraging the Internet\".</p><p>At [$DATETIME$], you were invited to become a (co-) author of the following ActionPlan:<br/><center>[$ACTIONPLANTITLE$]</center></p><p>The creation of successful action plans from card chains is the ultimate goal of the grand <i>mmowgli</i> experiment.  You receive points for participating in action plan, so you are encouraged to participate.  Click the <i>Take Action</i> button in the <i>mmowgli</i> page header to view the list of plans on the <i>Action Dashboard</i>.  Find the correct plan and follow the directions.</p><p><i>mmowgli</i> periodically sends mail to users notifying them of important game events.  Other players may also send you direct messages, but this is through the game interface and your email address is always kept private.  If you prefer to receive no email messages during <i>mmowgli</i> game play, you may opt out by visiting your User Profile page and checking the appropriate box.</p><p>Your User Profile page is available to you by clicking your game name in the <i>mmowgli</i> page header.</p><p>Problems may always be reported on the <a href=\'[$TROUBLELINK$]\'>MMOWGLI Trouble Report</a> page at [$TROUBLELINK$].</p><p>Thanks for playing [$GAMEACRONYM$] mmowgli.</p>','<p>Your [$GAMEACRONYM$] [$GAMEHANDLE$] account has been confirmed.  You are welcome to play the game.<br/>[$GAMEURL$]</p><p>If you receive this message in error, indicating, perhaps, that someone has gained entry by pretending to use your account, please notify us immediately via a Trouble Report.</br>[$TROUBLELINK$]</p><p>Thanks for your interest in playing <i>[$GAMEACRONYM$] [$GAMEHANDLE$]</i>.  <b>Play the game, change the game!</b></p>','<p>Greetings, <b>[$UNAME$]</b>, from <i>[$GAMEACRONYM$] mmowgli</i>, the \"Massively Multiplayer Online War Game Leveraging the Internet\".</p><p>At [$DATETIME$], you enrolled a new player name [$UNAME$] in <i>mmowgli / [$GAMENAME$]</i> at <a href=\'[$GAMEURL$]\'>[$GAMEURL$]</a>, and we\'re glad to have you.</p><p>If this enrollment was in error, or your email address was somehow used by someone else without your permission, please notify us at <a href=\'mailto:[$TROUBLEMAILTO$]\'>[$TROUBLEMAILTO$]</a> and we will take corrective action.  You can also submit a Trouble Report at <a href=\'[$TROUBLELINK$]\'>[$TROUBLELINK$]</a>.</p><p><i>[$GAMEACRONYM$] mmowgli</i> periodically sends mail to users notifying them of important game events.  Other players may also send you direct messages, but this is through the game interface and your email address is always kept private.  If you prefer to receive no email messages from <i>mmowgli</i> game play, you may opt out by visiting your User Profile page and checking the appropriate box.</p><p>When logged in, your User Profile page is available to you by clicking your game name in the <i>[$GAMEACRONYM$] mmowgli</i> page header.</p><p>More information is also available on the <a href=\'[$PORTALLINK$]\'>MMOWGLI Portal</a>.</p><p>\"How to Play\" tips can be found on the <a href=\'[$HOWTOPLAYURL$]\'>Game Instructions</a> page.</p><p>Problems may always be reported on the <a href=\'[$TROUBLELINK$]\'>MMOWGLI Trouble Report</a> page at [$TROUBLELINK$].</p><p>Thanks for your interest in playing [$GAMEACRONYM$] mmowgli.  <b>Play the game, change the game!</b></p>','[$GAMEHANDLE$]: Signup Confirmation','[$GAMEHANDLE$]: Signup Confirmation Reminder','Your [$GAMEHANDLE$] registration','[$GAMEHANDLE$]: Invitation to author Action Plan','<p>Greetings, <b>[$UNAME$]</b>, from <i>[$GAMEACRONYM$] [$GAMEHANDLE$]</i>, the \"Massively Multiplayer Online War Game Leveraging the Internet.\"</p><p>At [$DATETIME$], someone (presumably you) requested a password reset for <i>[$GAMEHANDLE$] / [$GAMENAME$]</i>.</p><p>In order to ensure the security of your account, please <a href=\'[$CONFIRMLINK$]\'>confirm your password reset request</a>.</p><br /><p>This process only remains active for three hours. If you have not changed your password within this time frame, then you will have to re-initiate this process from the <i>[$GAMEACRONYM$] [$GAMEHANDLE$]</i> login in screen.<br /><!-- TODO add link --></p><p>You can report any problems by sending a <a href=\'[$TROUBLELINK$]\'>[$GAMEHANDLE$] Trouble Report</a> at <a href=\'[$TROUBLELINK$]\'>[$TROUBLELINK$]</a>.</p><p>You can also send trouble-report email directly to <br /><a href=\'mailto:[$TROUBLEMAILTO$]\'>[$TROUBLEMAILTO$]</a>.</p><p>More information is also available on the <a href=\'[$PORTALLINK$]\'>[$GAMEHANDLE$] portal</a>.</p><p>Thanks for your interest in <i>[$GAMEACRONYM$] [$GAMEHANDLE$]</i>.  Play the game, change the game!</p>','Your [$GAMEHANDLE$] password reset confirmation','<p>Greetings all <i>mmowgli / [$GAMENAME$]</i> Administrators</p><p>At [$DATETIME$], a new Game Master, [$UNAME$], completed registration for [$GAMENAME$].</p><p>Please log on to <a href=\'[$GAMEURL$]\'>[$GAMEURL$]</a> at your convenience and enable all pertinent permissions for GM [$UNAME$] so that they may commence building [$GAMENAME$] for play.</p>','A new Game Master has registered for [$GAMEHANDLE$]');

